    struct RoomData{
        uint playerNum;
        uint roomMoney;//
        uint playerEnterdCount;//adduser
        uint [6] rollNumList;
        address [6] addressList;
        uint [6] winMoneyList;
    }

    mapping (uint => RoomData) public allRoomsMap;//roomIDroom
    uint maxRoomID=0;//ROOMID0+1ID
    uint [] public unfinishedRoomID;//ID
    uint [] public hotWinRoomID;//hotwinID
    uint [] public finishedRoomID;//ID
    uint [] public winnerMoney;//4

    address owner;
    //
    uint commission = 0;
    //1/10000
    uint commissionProportion = 0;

    mapping (address => uint) playerRollNum;
    uint time_random=0;
    uint maxNum = 0;

    event LogSentRoomData(uint roomID, uint playerNum, uint roomMoney, uint playerEnterdCount, uint [6] rollNumList, address [6] addressList, uint [6] winMoneyList);
    event LogSentLists(uint[] unfinishedRoomID,uint[] hotWinRoomID,uint[] finishedRoomID,uint[] winnerMoney);

    event sendData(uint logData);

    function PlayDice() public{
         maxRoomID=0;
         owner = msg.sender;
    }

    // get commission money
    function getContractMoney(address target) public payable{
        require(msg.sender == owner);
        target.transfer( commission );
    }

    //kill self
    function killContract() public{
        require(msg.sender == owner);
        selfdestruct( owner );
