    //20idstartID20
    function getUnfinishedRoomIDs(uint startID) public view returns(uint[] memory backUnfinishedRoomIDs)
    {

        backUnfinishedRoomIDs = new uint[](20);
        uint i=0;
        uint j=0;
        for (i; i < backUnfinishedRoomIDs.length; i++) {
            backUnfinishedRoomIDs[i] = 0;
        }

        i=0;
        if( unfinishedRoomID.length > startID ){

            if ( unfinishedRoomID.length - startID >= 20 ){
                for (i=startID; i<startID+20; i++){
                    backUnfinishedRoomIDs[j] = unfinishedRoomID[i];
                    j++;
                }
            }else{
                for (i=startID; i < unfinishedRoomID.length-startID; i++){
                    backUnfinishedRoomIDs[j] = unfinishedRoomID[i];
                    j++;
                }
            }   

        }

        return backUnfinishedRoomIDs;
    }

    //20idstartID20
    function getFinishedRoomIDs(uint startFinishID) public view returns(uint[] memory backFinishedRoomIDs)
    {
        backFinishedRoomIDs = new uint[](20);
        uint i=0;
        uint j=0;        
        for (i; i < backFinishedRoomIDs.length; i++) {
            backFinishedRoomIDs[i] = 0;
        }

        i=0;
        if( finishedRoomID.length > startFinishID ){
            if ( finishedRoomID.length - startFinishID >= 20 ){
                for (i=startFinishID; i<startFinishID+20; i++){
                    backFinishedRoomIDs[j] = finishedRoomID[i];
                    j++;
                }
            }else{
                for (i=startFinishID; i < finishedRoomID.length-startFinishID; i++){
