    //
    function createRoom( uint playerNum ) public payable{
        //1maxRoomIDID
        //2RoomData
        //3unfinishedRoomID
        //4allRoomsMap
        //5roomID
        maxRoomID++;
        uint rid = maxRoomID;
        uint [6] memory rollNumList;
        rollNumList[0] = 0;
        address [6] memory addressList;
        addressList[0]=msg.sender;
        uint [6] memory winMoneyList;
        winMoneyList[0]=0;

        allRoomsMap[rid] = RoomData(playerNum, msg.value, 1, rollNumList, addressList, winMoneyList);
        unfinishedRoomID.push(rid);

        LogSentRoomData( rid,  allRoomsMap[rid].playerNum,  allRoomsMap[rid].roomMoney,  allRoomsMap[rid].playerEnterdCount,  allRoomsMap[rid].rollNumList, allRoomsMap[rid].addressList,  allRoomsMap[rid].winMoneyList);
        LogSentLists(unfinishedRoomID,hotWinRoomID,finishedRoomID,winnerMoney);

        // return maxRoomID;

    }

    //
    function joinRoom(uint roomID) public payable{
        //1ROOM
        //2roomMoney
        //3
        //4ROLL
        //5ROLLevent
        require ( allRoomsMap[roomID].playerEnterdCount < allRoomsMap[roomID].playerNum );
        RoomData roomData = allRoomsMap[roomID];
        require( msg.value == roomData.roomMoney );
        uint playerEnterdCount = roomData.playerEnterdCount;
        roomData.rollNumList[ playerEnterdCount ] = 0;
        roomData.addressList[ playerEnterdCount ] = msg.sender;
        roomData.winMoneyList[ playerEnterdCount ] = 0;
        roomData.playerEnterdCount++;

        if( roomData.playerEnterdCount == roomData.playerNum ){
            roll(roomID);
        } 

        LogSentRoomData( roomID,  allRoomsMap[roomID].playerNum,  allRoomsMap[roomID].roomMoney,  allRoomsMap[roomID].playerEnterdCount,  allRoomsMap[roomID].rollNumList, allRoomsMap[roomID].addressList,  allRoomsMap[roomID].winMoneyList);
        LogSentLists(unfinishedRoomID,hotWinRoomID,finishedRoomID,winnerMoney);

    }

    //roll
    function roll(uint roomID) private{
        //1unfinished list
        //2rollNum123
        //3winMoney0
        //4hotwinList
        //5finishedRoomID

        maxNum=0;
        uint i=0;
        uint j=0;
        time_random=0;

        for ( i=0; i<allRoomsMap[roomID].playerEnterdCount; i++ ){

            address playAdd= allRoomsMap[roomID].addressList[i];

            time_random = (now*i)%6+1;
            //rollStart
            playerRollNum[playAdd] = time_random;
            allRoomsMap[roomID].rollNumList[i] = time_random;
            //rollEnd 

            if ( time_random > maxNum ){
                maxNum = time_random;
            }

        }

        //
        address[] storage winnerAdd;

        for ( i=0; i<allRoomsMap[roomID].playerEnterdCount; i++ ){
            address player = allRoomsMap[roomID].addressList[i];
            if ( playerRollNum[player] == maxNum){
                winnerAdd.push( player );
            }
        }

        uint winnerM = allRoomsMap[roomID].roomMoney * allRoomsMap[roomID].playerEnterdCount;
        /*for ( i=0; i<allRoomsMap[roomID].playerEnterdCount; i++ ){
            winnerM +=  allRoomsMap[roomID].roomMoney;
            allRoomsMap[roomID].winMoneyList[i] = 0;
        }*/

        //
        uint winnerGet = winnerM / winnerAdd.length * (10000 - commissionProportion) / 10000;
        for (i=0; i<allRoomsMap[roomID].playerEnterdCount; i++ ){
            for (j=0; j<winnerAdd.length; j++ ){
                if( allRoomsMap[roomID].addressList[i]==winnerAdd[j] ){
                    allRoomsMap[roomID].winMoneyList[i] = winnerGet;
                }else{
                    allRoomsMap[roomID].winMoneyList[i] = 0;
                }
            }
        }
        commission += winnerM - winnerGet * winnerAdd.length;



        if( hotWinRoomID.length < 4 ){
            hotWinRoomID.push(roomID);
            winnerMoney.push(winnerM);
        }else{
            if( winnerMoney[3] < winnerM ){
                hotWinRoomID[3]=roomID;
                winnerMoney[3]=winnerM;
            }
        }


        //4
        uint len = hotWinRoomID.length;
        uint dRoomId;
        uint dWinnerM;

        for(i=0; i<len; i++){ 
            for(j=0; j<len; j++){ 
                uint acount1= winnerMoney[i];
                uint acount2 = winnerMoney[j];
                if( acount1 < acount2 ){ 

                    dWinnerM = winnerMoney[j]; 
                    winnerMoney[j] = winnerMoney[i]; 
                    winnerMoney[i] = dWinnerM;

                    dRoomId = hotWinRoomID[j]; 
                    hotWinRoomID[j] = hotWinRoomID[i]; 
                    hotWinRoomID[i] = dRoomId;

                } 
            } 
        }


        // delete, 
        for( i=0; i<unfinishedRoomID.length; i++ ){
            if ( unfinishedRoomID[i] == roomID  ){
                break;
            }
        }

        if (i != unfinishedRoomID.length-1 ){
            for ( i; i<unfinishedRoomID.length-1; i++ ){
                unfinishedRoomID[i] = unfinishedRoomID[i+1];
            }
        }
        delete unfinishedRoomID[unfinishedRoomID.length-1];
        unfinishedRoomID.length--;

        finishedRoomID.push(roomID);

    }


    //
    function getMoney(uint roomID) public payable returns (bool) {
        //1maproom
        //2winMoney00
        //3winMoney0transfertransfer

        uint i=0;
        uint amount;
        for(i; i<allRoomsMap[roomID].addressList.length; i++){
            if(msg.sender == allRoomsMap[roomID].addressList[i]){
                amount= allRoomsMap[roomID].winMoneyList[i];
                allRoomsMap[roomID].winMoneyList[i] = 0;
                break;
            }
        }

        address myAddress = this;

        require(amount > 0 && myAddress.balance > amount );
        msg.sender.transfer(amount);

        LogSentRoomData( roomID,  allRoomsMap[roomID].playerNum,  allRoomsMap[roomID].roomMoney,  allRoomsMap[roomID].playerEnterdCount,  allRoomsMap[roomID].rollNumList, allRoomsMap[roomID].addressList,  allRoomsMap[roomID].winMoneyList);
        return true;

    }

